    FieldError,
    FormContainer,
    FormSuccess,
    Input_RF,
    Input_RF2,
    Label,
    MutedLink,
    SubmitButton,
    FormError,
    Validity
  } from "./common";
export default function TestPage() {


  const users = [
    {
        Question:"question1",
        Options_a :"a",
        Options_b :"b",
        Options_c :"c",
        Options_d :"d",
    

    }
   ,
   {
    Question:"question2",
    Options_a:"a",
    Options_b:"b",
    Options_c:"c",
    Options_d:"d",


} ];    

    return (
        <div>


<br/>
<FieldContainer_RF> 
     <BoxContainer> You have total 10 numbers of Questions.</BoxContainer>
<BoxContainer >Each Question has 1 number.</BoxContainer>


</FieldContainer_RF>


            {/* <h1>{doubled}</h1> */}
            <ul>
            <li> {users.Question}</li>
            {/* <li> {users.Question}</li> */}
            <li> {users.Options_c}</li>
            <li> {users.Options_d}</li>
            </ul>
        </div>
